import styled from "styled-components";
import React from "react";

const Image = (props) => {
  const {
    src,
    _onClick,
  } = props;

  const styles = {
    src: src,
    _onClick: _onClick,
  };

  return (
    <React.Fragment>
      <MyProfile {...styles} onClick={_onClick} />
    </React.Fragment>
  );
};

Image.defaultProps = {
  src: "data:image/jpeg;base64,",
  _onClick: () => {},
};



const MyProfile = styled.div`
  width: 170px;
  height: 170px;
  border: 1px solid #000;
  border-radius: 999px;
`;


export default Image;
